import React, {Component} from 'react';

import './Documentation.css';

export default class Documentation extends Component {

    constructor() {
        super();

        this.state = {
            status: null,
            message: null,
            
        }
    }

    render() {
        return (
            <div className="documentation">
                <div className="container">
                    <div className="row">
                        <div className="col-12">
                            <h2>ng new</h2>
                            <p>
                                The Angular CLI makes it easy to create an application that already works,
                                right out of the box. It already follows our best practices!
                            </p>
                            <h2>ng generate</h2>
                            <p>
                                Generate components, routes, services and pipes with a simple command.
                                The CLI will also create simple test shells for all of these.
                            </p>
                            <h2>ng serve</h2>
                            <p>
                                Easily test your app locally while developing.
                            </p>
                            <h2>Test, Lint</h2>
                            <p>
                                Make your code really shine.
                                Run your unit tests, your end-to-end tests,
                                or execute the official Angular linter with the breeze of a command.
                            </p>
                            <button>GET STARTED</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
};
